import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Chat from './components/Chat';
import Dashboard from './components/Dashboard/Dashboard';
import CustomerList from './components/Dashboard/CustomerList';
import AnalyticsOverview from './components/Dashboard/AnalyticsOverview';
import InteractionList from './components/Dashboard/InteractionList';
import TicketList from './components/Dashboard/TicketList';
import { AuthProvider, useAuth } from './context/AuthContext';



const PrivateRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return <div>Loading...</div>;
  }

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  return children;
};

// Component to handle role-based routing
const RoleRoute = ({ children, allowedRole }) => {
  const { user } = useAuth();

  if (user?.role !== allowedRole) {
    return <Navigate to={user?.role === 'client' ? '/dashboard' : '/chat'} replace />;
  }

  return children;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Login route - always accessible */}
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<Navigate to="/login" replace />} />

          {/* Protected route - Chat (for customers) */}
          <Route
            path="/chat"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="customer">
                  <Chat />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Protected route - Dashboard (for clients) */}
          <Route
            path="/dashboard"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="client">
                  <Dashboard />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Protected route - Customers (for clients) */}
          <Route
            path="/customers"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="client">
                  <CustomerList />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Protected route - Analytics (for clients) */}
          <Route
            path="/analytics"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="client">
                  <AnalyticsOverview />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Protected route - Interactions (for clients) */}
          <Route
            path="/interactions"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="client">
                  <InteractionList />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Protected route - Tickets (for clients) */}
          <Route
            path="/tickets"
            element={
              <PrivateRoute>
                <RoleRoute allowedRole="client">
                  <TicketList />
                </RoleRoute>
              </PrivateRoute>
            }
          />

          {/* Fallback route */}
          <Route path="*" element={<Navigate to="/login" replace />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
